sys_variable_value.value:
(function execute(inputs, outputs) {
var gr = new GlideRecord('x_snc_tbx_config_adm_ref_params');
gr.query();

var str="{ \n";
var site=inputs.site;
var env=inputs.env;  
while (gr.next()) {
    if (gr.o_site==site && gr.o_env==env){ 
  	str= str + "\""+gr.key+"\" : \""+gr.o_value + "\",\n";
    }
}
str = str.slice(0, - 2); //remove last comma
var str = str+ "}"  

outputs.jsonstring=str;
})(inputs, outputs);

